var ResponseCode = {
    SUCCESS : 0
}
/**
 * 检查返回的多个response对象，多个时每个会被包在数组的第一个元素
 * @param responseArray
 * @returns {boolean}
 */
function checkResponseArray(responseArray) {
    for (var i = 0; i < responseArray.length; i++) {
        if (responseArray[i] != null && responseArray[i][0].code != ResponseCode.SUCCESS) {
            showError(responseArray[i][0].description)
            return false;
        }
    }
    return true
}
//检查返回的单个response对象
function checkResponse(response) {
    if (response.code != ResponseCode.SUCCESS) {
        showError(response.description)
        return false;
    }
    return true
}

function isEmpty(strVal) {
    if (strVal == undefined || strVal == '' || strVal == null) {
        return true;
    } else {
        return false;
    }
}


