var isGetDataFromSamePage = false;//防止重复请求同一页的数据
var scrollBottomLoadMore = {
    dataFn:null,
    options:{
        distance:200,
        loadFirstPage: true
    },
    init: function (getDataFn, options) {
        var _this = this;
        _this.dataFn = getDataFn;
        if(options){
            $.extend(_this.options, options);
        }

        isGetDataFromSamePage = false;
        var $document = $(document);
        var containerId = window;
        if(options && options.containerId){
            $('html').css("overflow-y","hidden");
            containerId = options.containerId;
            $document = $(containerId);
        }

        var loadData = function () {
            isGetDataFromSamePage = true;
            _this.dataFn && _this.dataFn(function () {
                isGetDataFromSamePage = false;
            });
        };
        if(_this.options.loadFirstPage){
            loadData();//默认先加载一页
        }

        $(containerId).on("scroll", _.throttle(function () {
            var winHeight = $(window).height();
            if($(window).scrollTop() + winHeight >= $document.height() - _this.options.distance){
                if(isGetDataFromSamePage) return;
                loadData();
            }
        }, 500))
    },
    changeDataFn: function (getDataFn) {
        this.dataFn = getDataFn;
        isGetDataFromSamePage = false;
    }
};

