var pv = (function () {
    var _targetType = {
        ARTICLE: 1,
        PAPER: 2,
        CODE: 3,
        COLLECTION: 4,
        COMPETITIONS: 5,
        USER: 6,
        BANNER_RIGHT_TOP:7
    };

    //用户操作
    const _operation = {
      MOUSE_CLICK:'click',
      DETAIL_VIEW:'detail-view',
      SCROLL_VIEW:'scroll-view'
    };

    var _THRESHOLD = 20;

    var _gatheringPoll =[];//操作轨迹
    if(localStorage.getItem("gatheringPoll")){
        _gatheringPoll = JSON.parse(localStorage.getItem("gatheringPoll"));
    }


    var _load_start = new Date().getTime();
    var _pageUrl = document.location.href;//页面路径
    var _referrer = window.top.document.referrer || window.parent.document.referrer || document.referrer;//来源
    var _position = _pageUrl.substring(_pageUrl.indexOf(location.host) + location.host.length);


    //监听鼠标点击事件
    var _mouseEvent = function (e) {
        var targ ;
        if (!e) var e = window.event ;
        if (e.target) targ = e.target ;
        else if (e.srcElement) targ = e.srcElement ;//兼容ie
        if (targ.nodeType == 3) targ = targ.parentNode ; // Safari bug

        if($(targ).parents(".article-item").length == 0 && $(targ).parents(".banner-right-top").length == 0){
            return;
        }
        var ttype, tid;
        //判断是否是文章
        if($(targ).parents(".article-item").length == 1){
            if(_checkClickElement(targ)){//忽略无用的点击
                ttype = _getTargetType(targ) && _getTargetType(targ).value;
                tid = _getTargetId(targ);
                ttype = ttype && tid ? ttype : null;
            }
        }else if($(targ).parents(".banner-right-top").length == 1){
            ttype = _targetType.BANNER_RIGHT_TOP;
        }
        _gatheringPoll.push({
            position: _position,
            operation: _operation.MOUSE_CLICK,
            targetType: ttype,
            targetId: tid,
            refer: _referrer
        });
        localStorage.setItem("gatheringPoll", JSON.stringify(_gatheringPoll));
        if(_gatheringPoll.length >= _THRESHOLD){
            _send();
            _gatheringPoll = [];
            localStorage.removeItem("gatheringPoll");
        }
    };

    var _getClickElementHref = function (_targ) {
        if(_targ) {
            var tname = _targ.tagName ;
            if(tname.toLowerCase() == "a"){
                if(_checkHref()){
                    return _targ.href;
                }else{
                    return null;
                }
            }else if($(_targ).parents("a").length == 1){
                var phref = $(_targ).parents("a")[0].href;
                if(_checkHref()){
                    return phref;
                }else{
                    return null;
                }
            }
        }else{
            return "";
        }
    };

    var _checkHref = function (_href) {
        if(_href != "javascript:void(0)" && _href != "#" && _href != "###"){
            return true;
        }else{
            return false;
        }
    }

    //点击事件中，只上报 a 以及 父节点包含a元素的
    var _checkClickElement = function (_targ) {
        var tname = _targ.tagName ;
        if(tname.toLowerCase() == "a" || $(_targ).parents("a").length == 1){
            return true;
        }
    };

    //页面关闭事件
    var _beforeunloadEvent = function () {
        var scrollY = document.documentElement.scrollTop || document.body.scrollTop;
        var wHeight = $(window).height();
        var pHeight = $(document).height();
        var ttype = _getTargetType() && _getTargetType().value;
        var tid = _getTargetId();

        //只上报文章相关的
        if(ttype == _targetType.ARTICLE && tid != null){
            _gatheringPoll.push({
                position: _position,
                operation: _operation.DETAIL_VIEW,
                targetType: ttype && tid ? ttype : null,
                targetId: tid,
                duration: _getDuration(),
                refer: _referrer,
                extra: JSON.stringify({
                    scroll: ((scrollY + wHeight)/pHeight).toFixed(1)
                })
            });
            localStorage.setItem("gatheringPoll", JSON.stringify(_gatheringPoll));
        }

        _send();
        _gatheringPoll = [];
        localStorage.removeItem("gatheringPoll");

    };

    var _send = function () {
        if(_gatheringPoll.length>0){
            var data = JSON.stringify(_gatheringPoll);
            $.ajax({
                url: contextPath + "/rest/behaviors",
                method: "post",
                data: data,
                contentType: "application/json; charset=utf-8",
                dataType: "json",
                statusCode:{
                    500: function (jqXHR) {
                        console.log("访问服务器异常：" + jqXHR.status + " - " + jqXHR.responseJSON.description);
                    }
                }
            })
        }
    };

    //获取页面停留时长
    var _getDuration = function () {
        var _load_end = new Date().getTime();
        var _duration = _load_end - _load_start;
        return _duration;
    };

    var _getTargetType = function (_targ) {
        var url = _getClickElementHref(_targ);
        return _getTargetTypeByUrl(url);
    };

    var _getTargetTypeByUrl = function (url) {
        if(url == null) return null;
        else if(url == '') url = _pageUrl;

        if(url.indexOf("codes") != -1 ){
            return {
                text: "codes",
                value: _targetType.CODE
            };
        }else if(url.indexOf("articles") != -1){
            return {
                text: "articles",
                value: _targetType.ARTICLE
            };
        }else if(url.indexOf("papers") != -1){
            return {
                text: "papers",
                value: _targetType.PAPER
            };
        }else if(url.indexOf("collections") != -1){
            return {
                text: "collections",
                value: _targetType.COLLECTION
            };
        }else if(url.indexOf("competitions") != -1){
            return {
                text: "competitions",
                value: _targetType.COMPETITIONS
            };
        }else if(url.indexOf("users") != -1){
            return {
                text: "users",
                value: _targetType.USER
            };
        } else{
            return null;
        }
    }

    var _getTargetId = function (_targ) {
        var url = _getClickElementHref(_targ);
        return _getTargetIdByUrl(url);
    };

    var _getTargetIdByUrl = function (url) {
        if(url == null) return null;
        else if(url == '') url = _pageUrl;

        var type = _getTargetTypeByUrl(url);
        if(!type){
            return null;
        }else{
            if(url.indexOf('#') != -1){
                url = url.substr(0, url.indexOf('#'));//去掉hash值
            }
            if(url.indexOf('?') != -1) {
                url = url.substr(0, url.indexOf('?'));//去掉参数
            }

            var str = url.substring(url.indexOf(type.text));
            if(str == undefined || str == null || str == ""){
                return null;
            }else{
                var arr = str.split("/");
                if(arr.length > 1){
                    if(!isNaN(parseInt(arr[1]))){
                        return arr[1];
                    }else{
                        return null;
                    }
                }else{
                    return null;
                }
            }
        }
    }

    //滚动事件处理
    var _scrollEvent = function () {
        //文章
        $("div.article-item>a").each(function () {
            if(_isElementInViewport(this)){
                //获取url
                var _href = this.href;
                if(_checkHref(_href)){
                    var ttype = _getTargetTypeByUrl(_href) && _getTargetTypeByUrl(_href).value;
                    var tid = _getTargetIdByUrl(_href);
                    _gatheringPoll.push({
                        position: _position,
                        operation: _operation.SCROLL_VIEW,
                        targetType: ttype && tid ? ttype : null,
                        targetId: tid,
                        refer: _referrer
                    });
                    _gatheringPoll = _.uniqWith(_gatheringPoll, _.isEqual);
                    localStorage.setItem("gatheringPoll", JSON.stringify(_gatheringPoll));
                }
            }
        });
        var bannerRight = $(".banner-right-top").get(0);
        if(bannerRight && _isElementInViewport(bannerRight)){
            _gatheringPoll.push({
                position: _position,
                operation: _operation.SCROLL_VIEW,
                targetType: _targetType.BANNER_RIGHT_TOP,
                refer: _referrer
            });
            _gatheringPoll = _.uniqWith(_gatheringPoll, _.isEqual);
            localStorage.setItem("gatheringPoll", JSON.stringify(_gatheringPoll));
        }

        if(_gatheringPoll.length >= _THRESHOLD){
            _send();
            _gatheringPoll=[];
            localStorage.removeItem("gatheringPoll");
        }
    }

    //判断元素是否在客户数区域
    var _isElementInViewport = function (el) {
        var rect = el.getBoundingClientRect();
        return (
            rect.top >= 0 &&
            rect.left >= 0 &&
            rect.bottom <= (window.innerHeight || document.documentElement.clientHeight) && /*or $(window).height() */
            rect.right <= (window.innerWidth || document.documentElement.clientWidth) /*or $(window).width() */
        );
    }

    return {
        mouseEvent: _mouseEvent,
        send: _send,
        beforeunloadEvent: _beforeunloadEvent,
        scrollEvent: _scrollEvent
    }
})();

